import styled from "styled-components";

const Button = styled.button`
  background: pink;
  border: 0.05rem solid gray;
  padding: 1rem;
  width: 8rem;
  margin: 0.5rem auto;
  display: block;
  font-size: 1.6rem;
  border-radius: 0.4rem;
`;

export default Button;
